import { Component, OnInit } from '@angular/core';
import { FoodService } from 'src/app/services/food.service';
import { Food } from 'src/app/shared/models/Food';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent implements OnInit {

   foods:Food[] | undefined

constructor(private foodService:FoodService){}

  ngOnInit(): void {

this.foods=this.foodService.getAll()


  }

}
<div class="container py-5">

    <div class="row">


        <div class="col-md-6" *ngFor="let food of foods">
            <div class="card" >
                <img src="{{food.imageUrl}}" class="card-img-top" alt="...">
                <div class="card-body">
                  <h5 class="card-title">{{food.name}}</h5>
                  <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                  <star-rating value="{{food.stars}}" totalstars="5" checkedcolor="red" uncheckedcolor="black" size="24px" readonly="false" (rate)="onRate($event)"></star-rating>
                  <!-- <a href="#" class="btn btn-primary">Go somewhere</a> -->
                </div>
              </div>

        </div>
    </div>
</div>
